MAINPAGE = '''<!DOCTYPE html>
<html>
<html>
  <head>
	<link rel="stylesheet" href="pts.css">
	<link href="https://fonts.googleapis.com/css2?family=M+PLUS+Rounded+1c&display=swap" rel="stylesheet">
  </head>
  <body>
	<div class="header">
        <div class="header-right">
				<img class="logo" name="logopic" style="float:left; height:57px; background-color:#f0f0f0" src="images/logo.png" alt="name">
			<ul>
				<li style="float:right; background-color:#46AE7C;"><a href="#apply">Apply</a></li>
				<li style="float:right"><a href="#tutoringservices">Tutoring Services</a></li>
				<li style="float:right"><a href="#whoarewe">Who Are We?</a></li>
				<li style="float:right"><a href="#home">Home</a></li>
			</ul>
        </div>
    </div>
    <div class= "mainpage">
		<!-- <hr width="75%"> -->
		<!-- <hr width="95%"> -->
		<br></br>
		<a name="home"></a>
        <h1 name="home" style="font-size:60px;color:#5784BD;text-align:center;">PANDEMIC TUTORING SERVICES</h1>
		<div class="slogan">
			<h2>Provided by MSU Students</h2>
		</div>
		<!-- <hr width="95%"> -->
		<!-- <hr width="75%"> -->
	</div>
	<div class= "whoarewe">
		<a name="whoarewe"></a>
		<h4>Who Are We?</h4>
		<p style="float:right;"><img src="images/screen.png"></p>
		<p>As the 2020-21 school year approaches, the COVID-19 pandemic continues to force many school districts to designate learning to be completed virtually. Pandemic Tutoring Services is a volunteer organization created to supply additional 1 on 1 and small group services to students for free as they adapt to learning online. This organization was formed by and consists of Michigan State students with a mission to support learning within the Lansing School District for the duration of the coronavirus pandemic. This has been and will continue to be a difficult year; however, when we band together, we can overcome the challenges which arise from this virus.</p>
	</div>
	<div class= "tutoringservices">
		<a name="tutoringservices"></a>
		<h4>Tutoring Services</h4>
		<p style="float:left;"><img src="images/subjects.png"></p>
		<p>We are offering FREE tutoring services for students grade 7-12 in the Lansing School District via video chat in Math and English.  If there is another subject you or your student needs extra support in, please feel free to email James Kinville at kinvill2@msu.edu and apply through the forms below. We are here to support you and will do our best in finding tutors to guide you through this new challenge of virtual learning.</p>
	</div>
	<div class= "apply">
		<a name="apply"></a>
		<h5>Apply</h5>
		<p>To apply for a tutor, please fill out and submit the form below. We will do our best to get back to you as soon as possible, as we know the importance of getting help quickly.</p>
		<br></br>
	</div>
	<div class="footer">
		<h3>Contact Us: kinvill2@msu.edu</h3>
	</div>  
  </body>
</html>
'''

